import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import { Box, Typography, Tab, Tabs, List, ListItem, ListItemText, Paper, Grid } from '@mui/material';
import { recent, least, progress } from '../../Types';

axios.defaults.baseURL = 'http://35.208.70.236/';

function Progress() {
  const [activeTab, setActiveTab] = useState<number>(0); // 0 for GRE, 1 for TOEFL
  const [recentWords, setRecentWords] = useState<recent[]>([]);
  const [leastLearnedWords, setLeastLearnedWords] = useState<least[]>([]);
  const [progressPercentage, setProgressPercentage] = useState<progress[]>([]);

  const { Email } = useParams<{ Email: string }>();

  useEffect(() => {
    const testId = activeTab === 0 ? 0 : 3;

    const fetchData = async () => {
      try {
        const [recentRes, leastRes, progressRes] = await Promise.all([
          axios.get(`/api/Learns/recent`, { params: { Email, num_words: 10 } }),
          axios.get(`/api/Learns/least`, { params: { Email, TestId: testId, num_words: 10 } }),
          axios.get(`/api/Learns/progress`, { params: { Email, TestId: testId } })
        ]);
        setRecentWords(recentRes.data);
        setLeastLearnedWords(leastRes.data);
        setProgressPercentage(progressRes.data);
      } catch (error) {
        console.error('Failed to fetch data:', error);
      }
    };

    if (Email) fetchData();
  }, [Email, activeTab]);

  const handleTabChange = (event: React.SyntheticEvent, newValue: number) => {
    setActiveTab(newValue);
  };

  return (
    <Box sx={{ flexGrow: 1, typography: 'body1', padding: 2 }}>
      <Typography variant="h4" gutterBottom>
        Learning Progress Dashboard
      </Typography>
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
        <Tabs value={activeTab} onChange={handleTabChange} centered>
          <Tab label="GRE" />
          <Tab label="TOEFL" />
        </Tabs>
      </Box>
      <Typography variant="h6" sx={{ mt: 2 }}>Test ID: {activeTab === 0 ? 0 : 3}</Typography>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <Paper elevation={3} sx={{ padding: 2 }}>
            <Typography variant="h6" gutterBottom>
              Recently Learned Words
            </Typography>
            <List>
              {recentWords.map((word, index) => (
                <ListItem key={index}>
                  <ListItemText primary={word.Word} secondary={`LastLearnedTime: ${word.LastLearnedTime}`} />
                </ListItem>
              ))}
            </List>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper elevation={3} sx={{ padding: 2 }}>
            <Typography variant="h6" gutterBottom>
              Words to Improve
            </Typography>
            <List>
              {leastLearnedWords.map((word, index) => (
                <ListItem key={index}>
                  <ListItemText primary={word.Word} secondary={`PercentLearned: ${word.PercentLearned}`} />
                </ListItem>
              ))}
            </List>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper elevation={3} sx={{ padding: 2 }}>
            <Typography variant="h6" gutterBottom>
              Progress Overview
            </Typography>

          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Progress;
